import Vue from 'vue'
import VueRouter from 'vue-router'
Vue.use(VueRouter);


const router = new VueRouter({
    mode:'history',
    routes:[
        {
            path:'/home',
            component:()=>import('@/views/Home') 
        },
        {
            path:'/test',
            component:()=>import('@/views/Test') 
        },
        {
            path:'/login',
            component:()=>import('@/views/Login') 
        },
        {
            path:'/detail',
            component:()=>import('@/views/Detail') 
        },
        {
            path:'/',
            component:()=>import('@/views/Home') 
        }
    ]
})

export default router
